AllDatas allDatasFromJson(String str) => AllDatas.fromJson(json.decode(str));
String allDatasToJson(AllDatas data) => json.encode(data.toJson());
class AllDatas {
  AllDatas({
      num? total, 
      num? totalHits, 
      List<Hits>? hits,}){
    _total = total;
    _totalHits = totalHits;
    _hits = hits;
}

  AllDatas.fromJson(dynamic json) {
    _total = json['total'];
    _totalHits = json['totalHits'];
    if (json['hits'] != null) {
      _hits = [];
      json['hits'].forEach((v) {
        _hits?.add(Hits.fromJson(v));
      });
